            !ResetConfigurationModuleAdapter.tryWithAnotherModule(configuration, getProperties().isDebug())) {
          TestsUIUtil.notifyByBalloon(project, started, rootNode, getProperties(), "in " + getTime());
        }
      }
    });
  }

public static Position getPosition(@NotNull final PsiElement element, final int startOffset, final int endOffset) {
    final int offset = element.getTextOffset();
    if (offset < startOffset) {
      return Position.BEFORE;
    }
    if (element.getTextOffset() < endOffset) {
      return Position.INSIDE;
    }
    return Position.AFTER;
  }

public static float[] toFloatArray(
		Collection<? extends Number> collection) {

		float[] newArray = new float[collection.size()];

		if (collection instanceof List) {
			List<Number> list = (List<Number>)collection;

			for (int i = 0; i < list.size(); i++) {
				Number value = list.get(i);

				newArray[i] = value.floatValue();
			}
		}
		else {
			int i = 0;

			Iterator<? extends Number> iterator = collection.iterator();

			while (iterator.hasNext()) {
				Number value = iterator.next();

				newArray[i++] = value.floatValue();
			}
		}

		return newArray;
	}

